import React from 'react';
import styled from 'styled-components';

const AddGoalContainer = styled('div')`
    width: 48px;
    height: 48px;
    background-color: green;
    position: fixed;
`;

export default class AddGoal extends React.PureComponent {
    render () {
        return (
            <AddGoalContainer>s</AddGoalContainer>
        )
    }
}
